import React from "react";


function Footer(){
    var date = new Date().toLocaleDateString()
    return (
        <div>
        <footer className = "footer">
        <p>&copy; Manasi Rajiv Weginwar - {date} </p>
        </footer>
        </div>
    );
}

export default Footer;
